import { BrowserRouter, Route, Routes } from "react-router-dom";
import HomePage from "./pages/HomePage";
import PageNotFound from "./pages/PageNotFound";
import GameEdit from "./components/GameEdit";
import { useEffect, useState } from "react";
import { GamesProvider } from "./contexts/GamesContext";

// TODO: use context API

function App() {
  return (
    <GamesProvider>
      <BrowserRouter>
        <Routes>
          <Route index element={<HomePage games={games} />} />
          <Route path="games/:gameId" element={<GameEdit games={games} />} />
          <Route path="/privacy-policy" element={<PageNotFound id={0} />} />
          <Route path="/terms-of-services" element={<PageNotFound id={0} />} />
          <Route path="/contact-us" element={<PageNotFound id={0} />} />
          <Route path="*" element={<PageNotFound id={1} />} />
        </Routes>
      </BrowserRouter>
    </GamesProvider>
  );
}

export default App;
